var Credencial = Credencial || {};
$(document).ready(function () {
    "use strict";
    var $inputFile = $("#pdf");
    $inputFile.on("change", function () {
        var sizeByte = this.files[0].size;
        var fileName = this.files[0].name;
        var siezekiloByte = parseInt(sizeByte / 1024);
        if(siezekiloByte > $(this).attr('size')){
            alert('El tamaño supera al límite permitido de 1MB');
            $(this).val('');
            return false;
        }else{
            var ext = fileName.split('.').pop();

            switch (ext) {
                case 'pdf':
                    break;
                default:
                    alert('La extención requerida debe ser (.pdf)');
                    this.value = ''; // reset del valor
                    this.files[0].name = '';
            }
        }
        Credencial.upload.previewFile();
    });

});
Credencial.upload = {
    previewFile: function () {
        "use strict";
        var thumbnail = document.querySelector("#pdf_thumbnail"),
            photo = document.querySelector("#pdf").files[0],
            reader = new FileReader();
        reader.onloadend = function (){
            thumbnail.src = "data:image/png;charset=utf-8;base64,";
        };
        if (photo) {
            reader.readAsDataURL(photo);
        } else {
            thumbnail.src = "";
        }
        return true;
    },
};

$(document).ready(function() {
    $('#limpiar' ).on( "click", function() {
        var controlInput = $("#pdf");
        controlInput.replaceWith(controlInput = controlInput.val('').clone(true));
        $('#pdf_thumbnail').attr('src', ''); // Clear the src

    });
});